import React, { useEffect, useState }  from 'react';

function Fecha(){

    const url = 'https://sedeaplicaciones.minetur.gob.es/ServiciosRESTCarburantes/PreciosCarburantes/EstacionesTerrestres/FiltroMunicipio/';
    const [fecha, setFecha] = useState();

    useEffect(() => {
        obtenerDatos();
    }, [])

    const obtenerDatos = async() => {
        const data = await fetch(url);
        const fecha = await data.json();
        setFecha(fecha);
    }

    return(
        <p className='text-center'>{fecha}</p>
    );
}

export default Fecha;
